@JunegeeFulmer It wasn’t as bad as I thought it would be.

It was worse.

Like I knew about the incest stuff and all that, but then there were just other baffling choices I didn’t see coming, like Steve being Black Panther and Wanda being the reason dinosaurs are in the Savage Land.

Amazon has ruthless efficiency.

But then there’s Disney, which has something few other companies have: nostalgia. If you can remember your childhood, odds are you can remember something Disney in it.

